import styled from "styled-components";

const SpanTitulo = styled.span`

width: 65px;
height: 28px;
top: -20px;
font-family: 'ROBOTO';
font-style: normal;
font-weight: 600;
font-size: 24px;
line-height: 28px;
color: #5B1F53;

`;

const Container = styled.div`
    gap: 2px;  
    width: 100%;
    border: 1px solid;
    padding-left: 20px;
    padding-top: 20px;
`;

const Icone = styled.div`
width: 65px;
height: 28x;
`;

const Subtitulo = styled.span`
    width: 50%;
    height: 16px;
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 16px;

    /* Color/Neutral/400 */
    color: #BFBFBF;

`;





export {SpanTitulo, Container,Icone, Subtitulo};
